(()=>{"use strict";class t{constructor(){this.__createNavSection(),this.__createContentSection()}__createNavSection(){document.getElementsByClassName("side-bar")[0].innerHTML='\n                                <div class="logo-details">\n                                    <i class="bx bx-menu" id="btn"></i>\n                                </div>\n                                <div class="projects">\n                                    <div id="project-tab">Projects</div>\n                                    <ul id="projects-list">\n                                    </ul>\n                                    <div id="project-input">\n                                        <button type="submit" id="btn-submit">\n                                            <i class=\'bx bx-folder-plus bx-sm\'></i>\n                                        </button>\n                                        <input id="project-name" type="text" placeholder="Enter project">\n                                    </div>\n                                </div>\n                            '}__createContentSection(){document.getElementsByClassName("content-container")[0].innerHTML='\n            <div class="todos-add-button">\n            <button type="submit" id="add-todo">\n                <i  class=\'bx bx-list-plus bx-sm\'></i>\n            </button>\n            </div>\n            \n            <div class="todo-items">\n\n                <div id="project--name-container">\n                    <div id="project--name">Project Name</div>\n                </div>\n\n                <div class="todo--item">\n                    <div id="control-buttons">\n                        <button type="submit">\n                            <i class=\'bx bx-edit-alt\'></i>\n                        </button>\n                        <input type="checkbox">\n                    </div>\n                    <div id="todo-content">\n                        <div id="todo-main">\n                            <div id="todo-title">Title</div>\n                            <div id="todo-description">Lorem ipsum dolor sit amet, consectetur adipisicing elit. Quam quod impedit sunt, a voluptatem placeat reprehenderit totam nihil, voluptates blanditiis est, in suscipit! Voluptatum beatae quis ad deserunt voluptatibus unde.</div>\n                        </div>\n                        <div id="todo-meta">\n                            <div id="todo-due-date">Due Date</div>\n                            <div id="todo-priority">Priority</div>\n                        </div>    \n                    </div>\n                </div>\n\n            </div>\n        '}createTodo(t,i,n,d){return`\n        <div class="todo--item">\n                    <div id="control-buttons">\n                        <button type="submit">\n                            <i class='bx bx-edit-alt'></i>\n                        </button>\n                        <input type="checkbox">\n                    </div>\n                    <div id="todo-content">\n                        <div id="todo-main">\n                            <div id="todo-title">${t}</div>\n                            <div id="todo-description">${i}</div>\n                        </div>\n                        <div id="todo-meta">\n                            <div id="todo-due-date">${n}</div>\n                            <div id="todo-priority">${d}</div>\n                        </div>    \n                    </div>\n                </div>\n        `}}new class{constructor(){new t}}})();